import Cart from './cart';

/**
 * Extends Cart by sorted items
 *
 * @class
 */
class CartSorted extends Cart {

	/**
	 * @constructor
	 */
	constructor() {
		super();
	}

	/**
	 * Adds item to the cart and sets a position for an item
	 *
	 * @param {Object} item  Can be any object, but must have an unique id
	 * @param {Number} count Amount of the item you want to add
	 * @param {Number} position Position of the cart
	 * @return {Cart}        Cart instance this
	 */
	add(item, count = 1, position = undefined) {
		if (typeof position === 'undefined') {
			throw new Error('Position is not defined');
		}

		this._items.push({item, count, position});
		super._save();

		return this;
	}

}

export default CartSorted;

import EventEmitter from 'wolfy87-eventemitter';

/**
 * Handles objects and provides simple cart interface.
 * Use it together with storage enginges to create persistancy
 *
 * @class
 */
class Cart extends EventEmitter {

	/**
	 * @constructor
	 */
	constructor() {
		super();

		this._items = [];
		this._options = [];
		this._storage = undefined;
	}

	/**
	 * Set storage engine
	 *
	 * @param  {Storage} engine Set storage enginge for use of cookie, localstorage, ...
	 * @return {Cart}        Cart instance this
	 */
	use(engine) {
		this._storage = engine;

		return this;
	}

	/**
	 * Init cart by passing options.
	 *
	 * @param  {Object} options [description]
	 * @return {Cart}        Cart instance this
	 */
	init(options = {}) {
		this._options = options;
		this._read()
			.then(
				this.set.bind(this)
			);

		return this;
	}

	/**
	 * Returns plain cart items
	 *
	 * @return {Array} Cart items
	 */
	get() {
		return this._items;
	}

	/**
	 * Set cart items
	 *
	 * @param {Array} items
	 */
	set(items) {
		if(items) {
			this._items = items;
		}
	}

	/**
	 * Adds an item to the cart
	 *
	 * @param {Object} item  Can be any object, but must have an unique id
	 * @param {Number} count Amount of the item you want to add
	 * @return {Cart}        Cart instance this
	 */
	add(item, count = 1) {
		if (this._contains(item)) {
			const index = this._index(item);
			this._items[index].count += count;
		} else {
			this._items.push({item, count});
		}
		this._save(this._items)
			.then(this._updated.bind(this));

		return this;
	}

	/**
	 * Removes an item from the cart
	 *
	 * @param  {Object} item An object already added to the cart
	 * @return {Cart}        Cart instance this
	 */
	remove(item) {
		if (this._contains(item)) {
			const index = this._index(item);
			this._items.splice(index, 1);
		}

		return this;
	}

	/**
	 * Empties the cart
	 *
	 * @return {Cart}        Cart instance this
	 */
	clear() {
		this.set([]);
		this._save(this.get());

		return this;
	}

	_updated() {
		this.emitEvent('update');
	}

	/**
	 * Checks if an item exists in the carts
	 *
	 * @param  {Objext} item
	 * @return {Boolean}
	 * @private
	 */
	_contains(item) {
		let contains = false;
		const uniqueId = this._options.identifier;
		for (let i = 0; i < this._items.length; i++) {
			if (this._items[i].item[uniqueId] === item[uniqueId]) {
				contains = true;
			}
		}

		return contains;
	}

	/**
	 * Returns the index of an item in the cart
	 *
	 * @param  {Object} item
	 * @return {Integer}
	 * @private
	 */
	_index(item) {
		let index = 0;
		const uniqueId = this._options.identifier;
		for (let i = 0; i < this._items.length; i++) {
			if (this._items[i].item[uniqueId] === item[uniqueId]) {
				index = i;
			}
		}

		return index;
	}

	/**
	 * Returns saved items
	 *
	 * @return {Array} Saved items
	 * @private
	 */
	_read() {
		let promise;
		if (this._storage) {
			promise = this._storage.read('cart');
		} else {
			promise = new Promise(fulfill => {
				fulfill();
			});
		}
		return promise;
	}

	/**
	 * Saves items
	 *
	 * @private
	 */
	_save(items) {
		if (typeof this._storage !== 'undefined') {
			return this._storage.save('cart', items);
		}
	}

}

export default Cart;

import StorageInterface from './storage-interface';

/**
 * @extends {Storage}
 */
class StorageCookie extends StorageInterface {

	/**
	 * Reads a cookie key
	 *
	 * @param  {String} key Identifier
	 * @return {Promise}
	 */
	read(key) {
		const that = this;
		const promise = new Promise((fulfill, reject) => {
			const cookies = that.all();

			if (cookies) {
				const json = cookies[key];
				const object = JSON.parse(json);
				fulfill(object);
			} else {
				reject();
			}
		});

		return promise;
	}

	/**
	 * Saves a cookie
	 *
	 * @param  {String} key Identifier
	 * @param  {Object} object Data to save
	 * @param  {Object} options
	 * @return {Promise}
	 */
	save(key, object, options = {}) {
		const json = JSON.stringify(object);
		const promise = new Promise((fulfill, reject) => {
			try {
				let str = `${this.encode(key)}=${this.encode(json)}`;

				if (object === null) {
					options.expiry = -1;
				}

				if (options.expiry && !options.expires) {
					options.expires = new Date(+new Date() + options.expiry);
				}

				if (options.path) {
					str += `; path=${options.path}`;
				}

				if (options.domain) {
					str += `; domain=${options.domain}`;
				}

				if (options.expires) {
					str += `; expires=${options.expires.toUTCString()}`;
				}

				if (options.secure) {
					str += '; secure';
				}

				document.cookie = str;
				fulfill();
			} catch (error) {
				reject(error);
			}
		});

		return promise;
	}

	/**
	 * Return complete cookie as object
	 *
	 * @return {Object}
	 */
	all() {
		return this.parse(document.cookie);
	}

	/**
	 * Parses cookie
	 *
	 * @param  {String} str
	 * @return {Object}
	 */
	parse(str) {
		const obj = {};
		const pairs = str.split(/ *; */);
		let pair = null;

		if (pairs[0] === '') {
			return obj;
		}

		for (let i = 0; i < pairs.length; ++i) {
			pair = pairs[i].split('=');
			obj[this.decode(pair[0])] = this.decode(pair[1]);
		}

		return obj;
	}

	/**
	 * Url encodes string
	 *
	 * @param  {String} value
	 * @return {String|null}
	 */
	encode(value) {
		try {
			return encodeURIComponent(value);
		} catch (e) {
			return null;
		}
	}

	/**
	 * Url encodes string
	 *
	 * @param  {String} value
	 * @return {String|null}
	 */
	decode(value) {
		try {
			return decodeURIComponent(value);
		} catch (e) {
			return null;
		}
	}
}

export default new StorageCookie();

/**
 * Storage interface
 *
 * @interface
 */
class Storage {

	/**
	 * Returns a saved string
	 * @return {Promise}
	 */
	read(key) {}

	/**
	 * Saves string
	 *
	 * @param {String} key   Identifier of the saved object
	 * @param {Object} object Object to be saved serialized
	 * @return {Promise}
	 */
	save(key, object = {}) {}

	/**
	 * Clears the storage
	 * @return {Promise}
	 */
	clear() {}

}

export default Storage;

import StorageInterface from './storage-interface';

/**
 * @extends {Storage}
 * @class
 */
class StorageLocalStorage extends StorageInterface {

	/**
	 * Reads a object from Local Storage
	 *
	 * @param  {String} key Identifier
	 * @return {Promise}
	 */
	read(key) {
		const promise = new Promise((fulfill, reject) => {
			const json = localStorage.getItem(key);
			const object = JSON.parse(json);
			fulfill(object);
		});
		return promise;
	}

	/**
	 * Saves a object to local storage
	 *
	 * @param  {String} key Identifier
	 * @param  {Object} object data to save
	 * @return {Promise}
	 */
	save(key, object) {
		const json = JSON.stringify(object);
		const that = this;
		const promise = new Promise((fulfill, reject) => {
			try {
				localStorage.setItem(key, json);
				fulfill(that);
			} catch (error) {
				reject(error);
			}
		});
		return promise;
	}

